import React from 'react'
import { FechaFicha } from './visualizacion/FechaFicha'

export const VisualizarFicha = (props) => {
    const {datosFicha} = props
    return (
        <div className="card p-3">
            <FechaFicha datosFicha = {datosFicha} />
            <div className="row">
                <div className="col-4">
                    <span className="h5">Rut paciente: </span>{datosFicha.rut}
                </div>
                <div className="col-4 h5">
                    Fecha nacimiento: {datosFicha.fecha_nacimiento}
                </div>

            </div>
        </div>

    )
}
